  \"Phenolic Impregnated Carbon Ablator (PICA) Gap Filler for Heat Shield Assemblies
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 16,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T03:31:34.551445\",\n\t\"name\":
  \"phenolic-impregnated-carbon-ablator-pica-gap-filler-for-heat-shield-assemblies-project-39bb5\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"During this program, Fiber Materials, Inc.
  (FMI) will develop practical methods for preparing Phenolic Impregnated Carbon Ablator
  (PICA) materials for joining thermal protection system segments and penetrations
  of the heat shield assembly. Current and future mission flight environments and
  designs, such as those for Mars Science Laboratory Aeroshell (MSLA) and anticipated
  for New Frontiers and Mars EDL missions, will be assessed. Capability of the developed
  solution(s) will address mechanical and thermal robustness, and performance under
  representative mission heating environment. The Phase 1 program evaluated candidate
  joining and gap-fill materials, and assessed joining design approaches for cost
  effective manufacturability and assembly. Material joining design, assembly methodology
  and material test performance was documented. The Phase 2 program will utilize materials
  developed during the Phase 1 program to test performance under representative environment(s).
  A down-selected material-joining approach will result in the design and fabrication
  of a mission-specific PICA sub-assembly. The prototype sub-assembly will demonstrate
  assembly methods and the prototype materials will be utilized for characterization
  and performance testing. The proposed materials, designs and methods are TRL &lt;=3.
  It is anticipated that TRL=&gt;6 will be achieved at the conclusion of a successful
  phase 2 program.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
